import styled from "styled-components";
import Radio from "./Radio";

const StyledRadio = styled(Radio)`
  padding: 0 3px;
  cursor: pointer;

  input {
    cursor: pointer;
  }

  label {
    color: black;
  }
`;

export default StyledRadio;
